// chatbotApi.js

import axios from "axios";

const API_URL = "http://localhost:5001"; // üö® Er dette riktig backend-url?

export const saveData = async (consent, messages) => {
  try {
      const response = await fetch("http://localhost:5001/api/saveData", { // üö® Bruk '/api/saveData'!
          method: "POST",
          headers: { "Content-Type": "application/json" },
          body: JSON.stringify({ consent, data: messages }),
      });

      const result = await response.json();
      console.log("Lagringsresultat:", result);
  } catch (error) {
      console.error("Feil ved lagring:", error);
  }
};

export const clearBackendData = async () => {
  try {
    await axios.post(`${API_URL}/clearData`);
  } catch (error) {
    console.error("Feil ved t√∏mming av data:", error);
  }
};

